import React from 'react';
import { Link } from 'react-router-dom';
import './styles/Accueil_all.css';

const Accueil = () => {
  return (
    <div className=''>
      <div className='acc-header'>
        <h1>Bienvenue sur la page Wakanda</h1>

        <div className='insc-conn'>
          <div>
            <Link to="/inscrip">Inscription</Link>
          </div>
          <div className='ptitebarre'></div>
          <div>
            <Link to="/connect">Connexion</Link>
          </div>
        </div>
      </div>
      <div className="acc-secondo">
        <img src="/images/livreur-jaune.png" alt="cecec" srcset="" />
      </div>
      <div className="acc-parlage">
        <div className="rapide"></div>
        <div className="fiable"></div>
        <div className="securiser"></div>
      </div>
    </div>
  );
};

export default Accueil;
